import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Navbar from './components/navbar.js';
import Projects from './components/projects';
import Resume from './components/resume.js';
import About from './components/about.js';
import Services from './components/services.js';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar/><br/>
        <Projects/><br/><br/>
        <Resume/><br/><br/>
        <About/><br/><br/>
        <Services/><br/><br/>
        <switch>
          <Route exact path = "/">
            <Navbar/>
          </Route>
          <Route path = "/projects">
            <Projects/>
          </Route>
          <Route path = "/resume">
            <Resume/>
          </Route>
          <Route path = "/about">
            <About/>
          </Route>
          <Route path = "/services">
            <Services/>
          </Route>
        </switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
